import './Portfolio.scss';

const Portfolio = () => {
  return (
    <div className="portfolio" id="portfolio">
      <h1 className="port-title">portfolio</h1>
      <ul>
        <li>featured</li>
        <li>web app</li>
        <li>mobile app</li>
        <li>designing</li>
        <li>branding</li>
      </ul>
      
    </div>
  )
}

export default Portfolio;
